import { configureStore } from "@reduxjs/toolkit";
import CartOpe from  './CartOpe'
import ProductOpe from './ProductOpe'
export default configureStore(
    {
        reducer:{
            cart:CartOpe,
            cart1:ProductOpe
        }
    }
)
